import React from 'react';
import myphoto from '../public/logo2.png'

const Home = () =>{
  return(
    <div class="row">
      <div class="col-sm-8" style={{opacity:"0%"}}></div>
      <div class="jumbotron col-sm-4">
        <img src={myphoto} height="70px" width="50px"/>
      </div>
    </div>
  );
}

export default Home;
